/*global System,self*/
import { Morph, Label, Menu } from "lively.morphic";
import { resource } from "lively.resources/index.js";
import MorphicDB from "lively.morphic/morphicdb/db.js";
import { obj, string, date, arr } from "lively.lang/index.js";
import { connect, disconnect } from "lively.bindings/index.js";
import { SnapshotInspector } from "lively.serializer2/debugging.js";
import { SnapshotEditor, loadPart } from "lively.morphic/partsbin.js";
import { AbstractPrompt, ListPrompt } from "lively.components/prompts.js";
import { MorphicDBPrompt, interactivelyChooseMorphicDB } from "lively.morphic/morphicdb/tools.js";
import { pt, Color } from "lively.graphics/index.js";
import {LoadingIndicator}from "lively.components";



export default class MorphicDBLowLevelEditor extends Morph {
  static get properties () {
    return {
      currentLocation: { defaultValue: '' },

      morphicDBName: {},
      serverURL: {},
      snapshotLocation: {}
    };
  }

  get commit () {
    const sel = this.get('object list').selection;
    return sel && sel.commit;
  }

  onLoad () {
    this.reload();
  }

  beforePublish () {
    this.reset();
  }

  reset () {
    this.morphicDBName = null;
    this.snapshotLocation = null;
    this.serverURL = null;

    this.get('object list').items = [];
    connect(this.get('object list'), 'selection', this, 'onSelectionChanged');

    connect(this.get('sort chooser'), 'selection', this, 'listObjects', {
      updater: async function ($upd) {
        const { LoadingIndicator } = await System.import('lively.components'); // can not be done via var mapping
        self.loadingIndicator = self.loadingIndicator || LoadingIndicator.open('Listing Entries...');
        if (this._isFetching) return;
        this._isFetching = true;
        try {
          await $upd(this.targetObj.currentLocation);
        } finally {
          this._isFetching = false;
          self.loadingIndicator.remove();
          self.loadingIndicator = null;
        }
      },
      varMapping: { self: this }
    });

    connect(this.get('deletion button'), 'fire', this, 'interactiveDeletion');
    connect(
      this.get('open report button'),
      'fire',
      this,
      'interactivelyOpenReportButton'
    );
    connect(this.get('edit json button'), 'fire', this, 'interactivelyEdit', {
      converter: () => 'interactivelyEditSnapshotJSON'
    });
    connect(
      this.get('edit package code button'),
      'fire',
      this,
      'interactivelyEdit',
      { converter: () => 'interactivelyEditPackageCode' }
    );
    connect(this.get('edit metadata button'), 'fire', this, 'interactivelyEdit', {
      converter: () => 'interactivelyEditMetadata'
    });
    connect(this.get('fix conflicts button'), 'fire', this, 'fixConflicts');
  }

  get morphicDB () {
    let { morphicDBName, serverURL } = this;
    if (!morphicDBName) return MorphicDB.default;
    if (!serverURL) serverURL = MorphicDB.default.serverURL;
    return MorphicDB.named(morphicDBName, { serverURL });
  }

  async reload (type) {
    this.loadingIndicator = LoadingIndicator.open('Loading');
    this.loadingIndicator.center = $world.visibleBounds().center();
    try { await this.listObjects(this.currentLocation); } finally {
      this.loadingIndicator.remove();
      this.loadingIndicator = null;
    }
  }

  async detectBrokenCommits () {
    const brokenCommits = [];
    for (const commit of this.get('object list').items) {
      try {
        await this.morphicDB.load(commit.value.commit);
      } catch (e) {
        brokenCommits.push([commit.value.commit, e]);
      }
    }
    return brokenCommits;
  }

  async verifyCommits () {
    const indicator = LoadingIndicator.open('verifying commits...');
    const brokenCommits = await this.detectBrokenCommits();
    if (brokenCommits.length) {
      $world.listPrompt('Broken Commits:', brokenCommits.map(([c, e]) => {
        return [c.name, e];
      }), {
        requester: this,
        onSelection: i => {},
        preselect: 0
      });
    }
    indicator.remove();
  }

  async listObjects (type) {
    const sel = this.get('object list').selection;

    this.currentLocation = type;

    let resources;

    if (type !== '' && type !== 'world' && type !== 'part') {
      $world.inform(`Unknown location ${type}`);
      this.get('object list').items = [];
      this.loadingIndicator.remove();
      return;
    }

    const db = this.morphicDB;
    let commits;
    if (type === '') {
      commits = (await db.latestCommits('world', true)).concat(
        await db.latestCommits('part', true)
      );
    } else {
      commits = await db.latestCommits(type, true);
    }

    let col1W = 0;
    let col2W = 0;
    let col3W = 0;
    let col4W = 0;
    for (const commit of commits) {
      col1W = Math.max(col1W, commit.name.length);
      col2W = Math.max(col2W, commit.type.length);
      col3W = Math.max(col3W, (commit.tags[0] || 'uncategorized').length);
      col4W = Math.max(col4W, commit.author.name + 17);
    }
    col1W++;
    col2W++;
    col3W++;
    col4W++;

    const conflicts = await db.fetchConflicts(true);
    const conflictsByTypeAndName = {};

    conflicts.commitConflicts.forEach(c => {
      const { doc: { type, name } } = c;
      const conflicts =
          conflictsByTypeAndName[`${type}/${name}`] ||
          (conflictsByTypeAndName[`${type}/${name}`] = []);
      conflicts.push(c);
    });
    conflicts.versionConflicts.forEach(c => {
      const { doc: { type, name } } = c;
      const conflicts =
          conflictsByTypeAndName[c.id] || (conflictsByTypeAndName[c.id] = []);
      conflicts.push(c);
    });

    const sortBy = this.get('sort chooser').selection;

    commits = arr.sortBy(commits, ea => {
      switch (sortBy) {
        case 'by category':
          return (ea.tags[0] || '').toLowerCase();
        case 'by name':
          return ea.name.toLowerCase();
        case 'by author':
          return ea.author.name.toLowerCase();
        case 'by date':
          return -ea.timestamp;
      }
    });

    const items = commits.map(commit => {
      const { timestamp, name, type, author, tags, deleted } = commit;
      const conflicts = conflictsByTypeAndName[`${type}/${name}`];
      const string =
          name +
          ' '.repeat(col1W - name.length) +
          type +
          ' '.repeat(col2W - type.length) +
          (tags[0] || 'uncategorized') +
          ' '.repeat(col3W - (tags[0] || 'uncategorized').length) +
          author.name +
          ' ' +
          date.format(new Date(timestamp), 'yyyy-mm-dd HH:MM') +
          ' '.repeat(col4W - (author.name + 17)) +
          (deleted ? ' DELETED' : '') +
          (conflicts ? ' CONFLICT' : '');
      return { isListItem: true, string, value: { conflicts, commit } };
    });

    this.get('object list').items = items;

    if (sel) {
      const newSel = items.find(
        ea => ea.value.commit.name === sel.name && ea.value.commit.type === sel.type
      );
      this.get('object list').selection = newSel;
    }

    if (!items.length) $world.inform(`no ${type} resources found`);
  }

  onSelectionChanged (sel) {
    this._snapshot = null;
  }

  async interactivelyLoadResources () {
    const choice = await $world.multipleChoicePrompt('What kind of objects to list?', {
      requester: this,
      choices: ['world', 'part']
    });
    if (!choice) return;

    return this.listObjects(choice);
  }

  interactivelyOpenReportButton () {
    return $world.openWorldMenu(null, [
      [
        'summary',
        async () => {
          const inspector = SnapshotInspector.forSnapshot(await this.ensureSnapshot());
          inspector.openSummary();
        }
      ],
      [
        'connections list',
        async () => {
          const inspector = SnapshotInspector.forSnapshot(await this.ensureSnapshot());
          inspector.openConnectionsList();
        }
      ],
      [
        'object references report',
        async () => {
          const inspector = SnapshotInspector.forSnapshot(await this.ensureSnapshot());
          inspector.openObjectReport();
        }
      ]
    ]);
  }

  async ensureSnapshot () {
    const { commit: { _id }, _snapshot } = this;
    if (_snapshot) return _snapshot;
    return (this.snapshot = await this.morphicDB.fetchSnapshot(
      undefined,
      undefined,
      _id
    ));
  }

  async interactivelyEdit (method) {
    const { commit, _snapshot } = this;
    const ed = new SnapshotEditor(
      commit,
      _snapshot || (await this.ensureSnapshot()),
      this.morphicDB
    );
    try {
      return await ed[method](save => {
        const [item] = this.get('object list').selectedItems;
        if (item && save.commit) Object.assign(item.value.commit, save.commit);
        if (save.snapshot) this._snapshot = save.snapshot;
        this.listObjects(this.currentLocation);
        const { name, type, _id } = save.commit;
        this.setStatusMessage(
          `Committed ${type}/${name}: ${string.truncate(_id, 6)}`
        );
      });
    } catch (err) {
      this.showError(err);
    }
  }

  interactiveDeletion () {
    const sel = this.get('object list').selection;
    const commit = sel && sel.commit;
    if (!commit) return;
    const { name, type, _id } = commit;
    const { morphicDB: db } = this;
    const items = [
      [
        'hard delete',
        async () => {
          const selections = this.get('object list').selections.map(m => m.commit).filter(Boolean);
          if (selections.length > 1) {
            const really = await $world.confirm(
              `Really do a hard delete of ${selections.length} items? No recovery possible!`,
              { requester: this }
            );
            if (!really) return;
            for (const { type, name } of selections) {
              try {
                await db.delete(type, name, false);
              } catch (err) {
                this.showError(err);
              }
            }
            this.reload();
            return;
          }
          const really = await $world.confirm(
            `Really do a hard delete of "${name}". No recovery possible!`,
            { requester: this }
          );
          if (!really) return;
          try {
            await db.delete(type, name, false);
          } catch (err) {
            this.showError(err);
          }
          this.reload();
        }
      ]
    ];
    if (commit.deleted) {
      items.push([
        'mark as not deleted',
        async () => {
          try {
            await db.deleteCommit(commit._id, false);
          } catch (err) {
            this.showError(err);
          }
          this.reload();
        }
      ]);
    } else {
      items.push([
        'mark as deleted',
        async () => {
          try {
            await db.commit({ ...commit, content: undefined, snapshot: null });
          } catch (err) {
            this.showError(err);
          }
          this.reload();
        }
      ]);
    }

    this.openMenu(items);
  }

  async changeMorphicDB () {
    const { db, dbs } = await interactivelyChooseMorphicDB();
    if (!db) return;
    const { name: morphicDBName, serverURL, snapshotLocation } = db;
    this.morphicDBName = morphicDBName;
    this.serverURL = serverURL;
    this.snapshotLocation = snapshotLocation;

    this.setStatusMessage(`MorphicDB: ${this.morphicDBName || 'default'}`);
    this.reload();
  }

  async fixConflicts () {
    const sel = this.get('object list').selection;
    const { commit, conflicts } = sel || {};
    if (!conflicts || !conflicts.length) return;

    const { type, name: n } = commit;
    const conflict = conflicts[0];

    if (conflicts.length > 1) {
      const items = conflicts.map(ea => {
        return {
          isListItem: true,
          value: ea,
          string: `${type}/${n} ${ea.kind} conflict (${ea.id})`
        };
      });

      const { selected: [choice] } = await $world.listPrompt('choose conflict', items, {
        requester: this
      });
      if (!choice) return;
      conflict = choice;
    }

    const merger = await loadPart('text merger');
    const a = conflict.conflicts[0];
    const b = conflict.doc;
    merger.targetMorph.open(JSON.stringify(a, null, 2), JSON.stringify(b, null, 2));
    const { merged } = await merger.targetMorph.whenDone();
    let mergedJson;

    if (!merged) return;

    try {
      mergedJson = JSON.parse(merged);
    } catch (err) {
      const workspace = await $world.execCommand('open workspace', {
        mode: 'json',
        content: merged
      });
      workspace.setStatusMessage('JSON parse error');
      return;
    }

    try {
      await this.morphicDB.resolveConflict({
        id: conflict.id,
        kind: conflict.kind,
        delete: [a._rev],
        resolved: mergedJson
      });
    } catch (err) {
      const workspace = await $world.execCommand('open workspace', {
        mode: 'json',
        content: merged
      });
      workspace.showError(err);
    }

    this.setStatusMessage('OK');
    this.reload();
  }

  async showVersions () {
    const sel = this.get('object list').selection;
    if (!sel) return;
    const commit = sel.commit;
    const db = this.morphicDB;
    const { name, type } = commit;
    const viewer = await loadPart('object version viewer');
    const { history, refs } = await db.history(type, name);
    viewer.initializeFromStartCommit(
      commit, db,
      { showRevertButton: true });
    return viewer.openInWindow({ title: `versions of ${type}/${name}` });
  }

  openCustomMenu () {
    const menuItems = [
      ['Open report', () => this.interactivelyOpenReportButton()],
      ['Show versions', () => this.showVersions()],
      ['Edit metadata', () => this.interactivelyEdit('interactivelyEditMetadata')],
      ['Edit snapshot JSON', () => this.interactivelyEdit('interactivelyEditSnapshotJSON')],
      ['Edit package code', () => this.interactivelyEdit('interactivelyEditPackageCode')],
      ['Delete entry', () => this.interactiveDeletion()],
      ['Fix conflicts', () => this.fixConflicts()]
    ];
    this.openMenu(menuItems).topLeft = this.get('menu button').globalBounds().bottomLeft().addXY(0, 10);
  }
}

